import 'package:ieca_mobile/_import.dart';

class KkHymnsGeneral {
  static List<HymnsContent> list = [
    HymnsContent(id: 4900, position: 1, content: "O Nzanbi a vu nunkembela,\nA ndong’ezulu, wantu a nza,\nTutonda Se yoMwana mpe\nYe vuminu kiavelela.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_1, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4901, position: 1, content: "Tukembela Nge,\nE Nzambi o se,\nMuna Yisu wafwa,\nWafuluka, mpe.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4902, content: "Aleluya! Nkembo i waku;\nAleluya! Ámen!\nAleluya! Nkembo i waku;\nUtufulul’owau.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_2, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4903, position: 2, content: "Tukembela Nge,\nMuna mwand’aku mpe,\nWatusongel’o Mvuluzi\nA wantu a nza.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4904, position: 3, content: "Tukembela Nge\nMuna nzol’aku mpe,\nWatuvava, watukula,\nWatusongesela.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_2, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4905, position: 1, content: "Enza in’ak’e bu,\nTombe kivwididi,\nYo zowa mpe;\nE Nzame utuwa,\nKonso kukondele\nE nsangu zaku, awa,\nMbula kwakia", hymnsNumber: KkHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4906, position: 2, content: "E Mwan’a Nzambi wa!\nSe tadi ova nza,\nWantu se fwa;\nKatutul’e tombe kiau,\nTemes’ e ngindu zau,\nYovo omu ntima miau,\nMbula Kwakia.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4907, position: 3, content: "E Mwand’avelela,\nSe utulongisa,\nTwabak’o zayi.\nOva nz’amvimba mpe,\nMu nsi zawonsono,\nVo tombe kina vo,\nMbula Kwakia.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4908, position: 4, content: "E ntatu avelela\nNzambi a ndungidi,\nZola yo zayi,\nTuma e nsangu wau\nYakuna nsuk’a nza,\nWantu awonsono\nBankundanga,", hymnsNumber: KkHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4909, position: 1, content: "Nvuluzi numkembelelanga kaka,\nYeno i makangu mandi;\nYambula twamvana nvimba\nEki tuna kiau.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4910, position: 2, content: "Weto Nvuluzi tuntonda\nKadi utukasakese,\nYandi kaka yi vuvu kieto\nMuna vita yayi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4911, position: 3, content: "Bunda kaka Yisu evuvu,\nInkwa nkenda yo luvuluzu;\nNani olenda kunuvaula\nMuna Nvuluzi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4912, position: 4, content: "Toma kutulund’e Mfumu,\nNge tutadila yo fiauka,\nYaku ntangwa tusinga kwenda\nKuna yaku nsi,", hymnsNumber: KkHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4913, position: 5, content: "Kuna tuzolele kala,\nMuna Fwaniswa kiaku;\nIna ilembi zayakana\nTusinga kala yau.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4914, position: 1, content: "Nge Nzambi ampungu,\nwavelela beni,\nTukuyimbidila\nnkung’awankembo.\nNgeye u Nkwa nkenda,\nZamba a ngolo zingi,\nEse, yo Mwana,\nyoMuand’avelela.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_5, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4915, position: 2, content: "Aya bena koko\nbekukundang’aka;\nOku luse luaku\nbekukembela;\nAmbasi yo wantu\nbekuvuminanga;\nNgeye i Nzambi\nansigi kilu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_5, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4916, position: 3, content: "Nge Mfumu Nzambi\nwalungilamwawonso;\nKana vo kw’asumuki\nolembi moneka;\nNge i Nzambi ansongi,\nosundidi awonso;\nNge mosi kaka\ni Nzambi avelela.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_5, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4917, position: 4, content: "Nge Nzambi ampungu\na walakazi wingi;\nE vangwa yaku nkutu mpe\nyiyau ikukembela.\nNgeye u Kwa nkanka,\nNzambi a ngolo zingi,\nEse, yo Mwana, yo\nMwand’avelela.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_5, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4918, position: 1, content: "Kwa Nzambi tata wa nkembo\nuzolange Nsi,\nMwanandi wa fwila\nmuku ma kieto.\nMunkenda kasonga kwa’ sumu\nki ambi,\nWa yangule kielo kia zulu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4919, content: "Kiese wau, kiese wau,\nNwiza Kembelanga,\nKwa Yisu uludi,\nKwa Yisu nkundi’eto.\nKwa Nzambi tata wa Nkembo\nuzolange Nsi,\nWa tu tumi ni Yisu ka fwila yeto.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4920, position: 2, content: "Ensangu zambote,\nza Yisu Klistu.\nWa ntonda fwila ma\nSumu meto,\nE ntalu kafuta\nya menga mandi,\nMakukwa kwa eto\ntwa suku ka ôbi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4921, position: 3, content: "Nwa kwikila yandi,\nyo zola yandi.\nMu nkanda wa Nzambi\neto tanganga mo,\nWiza kwa yandi\nku kwikilanga\nVelelesa ntima\nWa mona Nzambi", hymnsNumber: KkHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4922, position: 1, content: "O Nfumu’eto okembelwa\nKwa wantu awonsono,\nKintinu kiezulu keyalanga,\nKayala, yala, yala yal’oza nza\nmpe.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4923, position: 2, content: "Asumuki tunkembela,\nOweto Mvuluzi,\nImoyo katuvevwela:\nKayala, yala, yala yakwayele\nmvu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4924, position: 3, content: "Owantu awonso ova nza\nNukwama kukembela,\nWa nkutu- bandu a Nzambi o Se,\nKayala, yala, yala Yakwayele\nmvu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4925, position: 4, content: "Ambasi nutusadisa\nYo yeno aveledi,\nO Yisu, ofwene kembelwa,\nYo yala, yala, yokwayele\nmvu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4926, position: 5, content: "O Nzambi utulungisa\nMu vu ki’aveledi,\nTwakwama kund’o Nvuluzi,\nKayala, yala, yala, yakwayele\nNvu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4927, position: 1, content: "O Nzambi Mpungu bu\ntuyindulanga\nMavanga, maukutusilanga,\nTumweni vo ukutubanzilanga\nMu kutuvana yi tuvingila.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4928, content: "O Mfumu, bika tuakuzitisa,\nKusambila mu kiedika!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4929, position: 2, content: "O Mfumu eto, bu tutoma tala\nBilekwa biena mu kayengele,\nBitatasana ye bisalasana\nZazonso ntangu zi biavangulwa.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4930, position: 3, content: "Tumweni kweto ntangu ya kuzulu\nYibutukanga nsuka miamionso\nMu kutuyotisa, mu kutukiesa,\nMu menisa zinkununu zazo.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4931, position: 4, content: "Na tadi zulu, bu diakidi duma,\nYe mbandanu, bu zeti tendana,\nYe mvula, bu zipasumuka beni,\nYe mpezomo, bu zeti vezima.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4932, position: 5, content: "Ye mbatu mbatu, bu tuwilu nuni,\nZisasulanga ndinga mu minti\nMu zitisanga mvangi au Nzambi,\nTubambulwanga, vo twayimbila.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4933, position: 6, content: "Ye mboki, bu tukukibanzilanga,\nTumweni, vo tuameni vangulwa\nMu toma luta yonso yena vava,\nMu fwanana ye Se diavanga nza", hymnsNumber: KkHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4934, content: "Tubanza, bika tuakunzitisa,\nKusambila mu kiedika.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.CHOIR),

    HymnsContent(id: 4935, position: 1, content: "Natu yaku e nkumbu a Yisu,\nOvo ntantu yizizietele.\nIkuyangidika kaka\nKonso kun’okwendanga.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_9, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4936, content: "Ekwe nkumbu… In’o wete…\nVuvu kieto ova nza\nEkwe nkumbu… In’o wete\nYau nkutu isaniswa.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_9, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4937, position: 2, content: "Nat’e nkumbu a Yisu kaka\nMuna ntambu u nkwa bwa\nAvo umpukumuni uzieta,\nE vuvu kiaku nkumbu yayi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_9, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4938, position: 3, content: "Ekwe nkumbu yayi ya Yisu,\nWete tumwenanga yo;\nYisu okututambulanga\nYeto mpe tunsanisa.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_9, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4939, position: 4, content: "Mu nkumbu yayi tufukamena\nVava ken’o Mvuluzi;\nNtinu a ntinu tukunyeka ma\nOva nza mwawonsono.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_9, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4940, position: 1, content: "E nzola katuzolele\nO Yisu vana nti ambi,\nTwatoma kulwa muna bi,\nKe ivovakana ko.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4941, content: "E nzol’andi isuvidi,\nE nzol’andi isuvidi,\nE nzol’ina katuzolele\nKe ivovakana ko,", hymnsNumber: KkHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4942, position: 2, content: "E mpasi zingi, ntantu mpe\nE mpwikw’a mpu a nsende mpe,\nTwakal’o moyo a mvu yamvu,\nKe ivovakana ko.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4943, position: 3, content: "Luvuvamu ngina luau\nO Nfumu ame wampana lo,\nE ntalu a menga mandi wau,\nKe ivovakana ko.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4944, position: 4, content: "E kiese ova kamfinama,\nE mpund’a ntima ngina yau:\nEvuvu kia monana,\nKe kivovakana ko.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4945, position: 1, content: "E zula yawonso yabukamw’o bi,\nO Ntemo a nza i Yisu!\nE mpuluza andi yakieses’e nza,\nE Ntemo a nza i Yisu!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4946, content: "Wiza ku ntemo! Nge utemene;\nYisu o ntim’ame okiesese wo:\nMpofo yakala, monanga wau\nO Ntemo a nza i Yisu!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4947, position: 2, content: "Oyeto mu Yisu twasukwilw’o bi,\nO Ntembo a nza i Yisu!\nNtemo tukiya vo vuvu twansia,\nA Ntemo a nza i Yisu!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4948, position: 3, content: "Oyeto mu tombe, mu fuku wa bi,\nO Ntemo a nza i Yisu!\nNutoma kumfinam’o kuma kwakia\nO Ntemo a nza i Yisu!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4949, position: 4, content: "Ku’zulu o mwini ke wina ko ko,\nO Ntemo a ezulu i Yisu!\nNvuluzi i ntemoyakwayele nvu;\nO Ntemo a nza i Yisu!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4950, content: "Wiza ku ntemo! Nge utemene;\nYisu o ntim’ame okiesese wo:\nMpofo yakala, monanga wau\nO Ntemo a nza i Yisu!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.CHOIR),

    HymnsContent(id: 4951, position: 1, content: "O Mpungu-Ngienda finama\nMakangu meto Yisu\nWayiza katuvuluza;\nNuwa e nding’a Yisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4952, content: "Nkunga ulutidi o wete,\nNkunga ulutidi o wete,\nNkunga ulutidi o wete,\nYisu, Nfumu Yisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4953, position: 2, content: "Masumu meto malolokwa,\nMu nfwa kafwi’lo Yisu,\nLuvuvamu tuvwidi wau,\nMu ntantu kamono’ Yisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4954, position: 3, content: "O Nvuluzi okenbelwa;\nTukwikil’omu Yisu;\nO wonga weto ukatuka,\nTuwidi ndinga Yisu", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4955, position: 4, content: "Ambuta nuiza kutusadisa,\nTwakundidika Yisu;\nEsambu diandi yikama,\nTwasanisinaYisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4956, position: 5, content: "A yi nyana-nyana nwiza mpe,\nTwasakidila Yisu;\nEsambu diani yikama,\nTwayangidika Yisu", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4957, position: 6, content: "Ku ‘zulu vo tulueke ko,\nTuamonana yo Yisu;\nEvu ya mbasi tuwanako,\nTwayimbidilaYisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4951, position: 1, content: "O Mpungu-Ngienda finama\nMakangu meto Yisu\nWayiza katuvuluza;\nNuwa e nding’a Yisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4952, content: "Nkunga ulutidi o wete,\nNkunga ulutidi o wete,\nNkunga ulutidi o wete,\nYisu, Nfumu Yisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4953, position: 2, content: "Masumu meto malolokwa,\nMu nfwa kafwi’lo Yisu,\nLuvuvamu tuvwidi wau,\nMu ntantu kamono’ Yisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4954, position: 3, content: "O Nvuluzi okenbelwa;\nTukwikil’omu Yisu;\nO wonga weto ukatuka,\nTuwidi ndinga Yisu", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4955, position: 4, content: "Ambuta nuiza kutusadisa,\nTwakundidika Yisu;\nEsambu diandi yikama,\nTwasanisinaYisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4956, position: 5, content: "A yi nyana-nyana nwiza mpe,\nTwasakidila Yisu;\nEsambu diani yikama,\nTwayangidika Yisu", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4957, position: 6, content: "Ku ‘zulu vo tulueke ko,\nTuamonana yo Yisu;\nEvu ya mbasi tuwanako,\nTwayimbidilaYisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4958, position: 1, content: "O wau tuzey’e nsangu ezi,\nYisu ovuluzang’enza;\nSamuna mwawonsono;\nYisu ovuluzang’e nza.\nMuna nsi zawonsono.\nKw’ana bena muna mbi,\nNdolo ateleka aka zo;\nYisu ovuluzang’e nza.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4959, position: 2, content: "Mwanganis’e nsangu ezi,\nYisu ovuluzang’e nza.\nAsumuki awonsono,\nYisu ovuluzang’e nza\nE nsi zambi kwikila,\nVutuka kwa Nvuluzi,\nOsia kunu kiesesa;\nYisu ovuluzang’e nza", hymnsNumber: KkHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4960, position: 3, content: "Muna zola kwandi wau,\nYisu ovuluzang’e nza;.\nMuna nkendazandi mpe\nYisu ovuluzang’e nza.\nMu lufwa lua eto wantu,\nMenga mandi mabunguka,\nDianu vo otulolokwa;\nYisu ovuluzang’e nza.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4961, position: 4, content: "Vuvu kingi tuna kiau,\nYisu ovuluzang’e nza:\nYambula twankembela,\nYisu ovuluzang’e nza\nNwiza wau minkwikisi,\nYo kuna ntemo a Nkûdi a nza\nLongi dia nfumu\nYisu ovuluzang’e nza.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4962, position: 1, content: "Ô wau nsamu wa Mfumu, Aleluya!\nMambu ma mbote ma Nzambi.\nYisu ovuluza ndonga, Aleluya!\nOlenda kutuvuluza.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_14, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4963, content: "Taleno ampangi owau,\nTaleno kwa Yisu owau,\nYandi vuluza asumuki etu, tonda,\nLanda oyo kuvuluza.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_14, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4964, position: 2, content: "Nfuka zeto wa futazo, Aleluya!\nYandi Yisu futidi mu nti;\nMoyo wandi venewo, Aleluya!\nYeno kulu songa kwa Nzambi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_14, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4965, position: 3, content: "Yandi kaidi kwa yeno, Aleluya!\nMoyo wa nvu ya nvu, kune zulu.\nTaleno kwa Yisu kaka, Aleluya!\nKwikilanga wau Nzambi’etu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_14, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4966, position: 4, content: "Tonda wau nvuluzi, Aleluya!\nLanda mu ntambi zani;\nLu mwanga nesa ensangu zandi, Aleluya!\nNkembelanga nkudi’eto Yisu", hymnsNumber: KkHymnsNumberSeeder.GENERAL_14, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4967, position: 1, content: "O Nzambi’eto i tininu\nO Ntanini ankaka’\nMu mbi zawonso sadisa\nKekutusadisanga.\nO Mbeni eto ambi\nOkutukondanga;\nE ngangu zandi zingi,\nYo umpolakanu wingi,\nWa ni okunsunda?", hymnsNumber: KkHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4968, position: 2, content: "E ngolo za eto wantu zike?\nSundwa tufwete sundwa:\nUmosi kak’olenda wo,\nUna kwa Se watumwa.\nNkumbu andi ozeye y’o?\nI Yisu Nvuluzi,\nWa Mwan’a Ntinu a vu:\nKesundakana ko.\nMu vita keza sunda.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4969, position: 3, content: "E nza ikutubangika\nMu kuma Nkadiampemba;\nO wonga ke umonwa ko,\nMu Yisu wa tusundila:\nE mbongo vo zisanzwa\nE nitu vo ivondwa;\nKe vena diambu ko:\nO Nzambi una kena;\nUnfumu wandi usikidi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4970, position: 1, content: "O Yisu o nkembo sisidi\nVava kakulumuk’ova nza;\nWamon’empasi, kafwididi,\nMu vuluza eto asumuki.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_16, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4971, content: "Edi dikumbwa kikilu,\nEdi dikumbwa mwawonsono;\nNtinu a’ntinu wayekolwa\nE kuma i yeto asumuki.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_16, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4972, position: 2, content: "Etumbu kieto wabaka kio,\nE mfuka zetowafuta zo,\nEsumu dieto wafwila dio,\nMu Yandi ke mwina kuma ko.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_16, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4973, position: 3, content: "Ntantu ye nsoni wamona zo.\nKansi kasala zo tina ko:\nWalembwa kw’ezulu,\nwavondwa kwa nza,\nKimana oyeto twavuluzwa.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_16, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4974, position: 4, content: "E mbidi a kiese tuna kiau,\nE mpasi zandi zivwidi owau,\nMu ngolo zandi ofukang’o bi;\nNukembel’ambasi yo wantu ova nsi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_16, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4975, position: 1, content: "Yisu Nge Makangu meto\nNge okutuzolanga;\nNge wanat’e tumbu yeto,\nWau okutubanzanga.\nNge olend’o wete,\nNtantu olend’o katula;\nAvo se tunat’o mambu\nOku sambu tukwendanga.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_17, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4976, position: 2, content: "Yisu Nge Makangu meto,\nNge okutulundanga\nMuna mpukumunwa zeto\nNge okutusadisa;\nYisu Nkundi eto beni\nNgemba zingi kieleka!\nAvo se tunat’o mambu\nOku sambu tukwendanga.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_17, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4977, position: 3, content: "Yisu Nge Makangu meto,\nNgeye watuvuluza;\nWau twakala wantu ambi\nSumu dieto wakatula;\nWau mu ntima mieto,\nKiese okutuvananga;\nAvo se tunat’o mambu\nOku sambu tukwendanga.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_17, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4978, position: 1, content: "E Nzambi umfinika oko kwa Nge!\nYisu unfilanga, wansadisa;\nNkunga yayimbila,\nNzambi yáfinama!\nE Nzambi unfinika oko kwa Nge!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4979, position: 2, content: "Wau nkangadilanga mu yayi nsi\nNsangu yasamuna za Nvuluzi;\nMu nzila nkwendela,\nNzambi, yáfinama!\nE Nzambi unfinika oko kwa Nge!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4980, position: 3, content: "Nfumu za yayi nsi sambula do!\nAnkak, eyaku fu baveza yo.\nYau bekunkadila:\nNzambi yáfinama!\nE nZambi unfinika oko kwa Nge!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4981, position: 4, content: "Avo yabangama, unsadisa\nYatoma kembela yo fiaukila.\nYisu unsimb’aka.\nNzambi yafinama!\nE Nzambi unfinika oko kwa Nge!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4982, position: 5, content: "E Nfumu unsonganga nzil’aku do!\nKu ‘zulu ifilanga, kiavilwa yo.\nMbasi zandaulwila\nNzambi yafinama!\nE Nzambi unfinama oko kwa Nge!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4983, position: 1, content: "Entangwa kiese yayimpe,\nO Yisu yandi Umpuluidi,\nKu kiese una ô ntima me,\nOmono wau yivavanga", hymnsNumber: KkHymnsNumberSeeder.GENERAL_19, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4984, content: "Kembela, kembela,\nOYisu owau unzolele,\nE Yisu undundanga sambila,\nYa ruikila ya sambanga.\nKembela, kembela,\nO Yisu wau unzolele.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_19, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4985, position: 2, content: "Wa lunga mpe ya muna nti,\nOYisu yandi Nfumu ame,\nUmbokela mu ndinga’ndi,\nYa zizila yo tina embi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_19, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4986, position: 3, content: "Ya vunda wau kwa Nvuluzi,\nMadia ma zulu umpananga,\nWa nvundi sa ya kembela,\nInkubiki insadisi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_19, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4987, position: 1, content: "Ungudi’ame Yeve,\nYo kumpana ya wonsono'\nYoku nsongela enzila\nKuna moyo wa nvo ya nvo.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4988, position: 2, content: "Yandi kumpevola ntima\nNgiendela munlungu amb’u;\nMu nzila itwa kubikilwa,\nMulu zolo lwa Yisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4989, position: 3, content: "Kani mundimba wa lufwa,\nYisu wonga wa nkatula wo,\nMambu ma Nfumu eto Yisu\nMena muna ntima me.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4990, position: 4, content: "Ngeye ku kiadi kia meza,\nKwa wana twa mengana\nNgeye kumpana, kumpana luzolo,\nÔ ntima me wa yela.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4991, position: 5, content: "Mumbote zaku za swame embi,\nMbi za wonso za fukuka,\nNgienda ya kala yo Nzambi\nKuna Nsi ya velela.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4992, position: 6, content: "Nkenda za Nfumu eto Yisu,\nZi ku mpulula muna lu fwa;\nMoyo ikala kwa Yisu,\nKune zulu ivundila.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4993, position: 7, content: "Mambu ma tata Yave,\nNwiza twa di wilamo;\nTwa toma wa Mambu ma\nNzambi Mpungu\nTwa di yekola mene.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4994, position: 1, content: "Nani yandi zolele fwete sambila\nLuvuluzu lwa nkenda nufwete tondalo;\nNga yeno tonda nulenda vuluka,\nAwei zolele kwiza owau?", hymnsNumber: KkHymnsNumberSeeder.GENERAL_21, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4995, content: "Awei zolele, awei zolele,\nKani mbevo kaka yandi lenda wa;\nTata ye kune Zulu, tomene monanga\nAwei zolele, wiza owau.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_21, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4996, position: 2, content: "Nani yandi zolele fwete kwiza wau\nE kia ki ekielo kia yangunka ,\nlenda kota wau;\nYandi Nfumu Yisu, zolele kotesa,\nWese zolele kwiza owau.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_21, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4997, position: 3, content: "Nani yandi zolele fwete landa wau\nYeno awonso nufwete kwiza mpe\nNani yandi zolele lenda kembela\nWese zolele kwiza owau.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_21, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4998, position: 1, content: "Ngwidi ndinga mbote,\nYa Klisto nvuluzi\nIbokelanga asumu ki.\nNwiza nwa vuluka.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4999, content: "Ikwiza Mfumu ame,\nIkwiza owaungina;\nMono mpe insumuki,\nNdinga ku Nfwete wa,", hymnsNumber: KkHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5000, position: 2, content: "Ma sumu mangina, mau.\nKilendi tanga ko;\nÔ menga maku ma itika,\nImau ma ku nsukula.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5001, position: 3, content: "Mu mpipa ya leka,\nÔ Yisu ute mwini;\nÔ Mwandaku wa velela,\nWa ndonga ôzaya nge.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5002, position: 1, content: "Wei fitakana kwa Yisu,\nE nkenda zaku mbuenezo;\nNga wangina yo mpasi za me,\nWantambula owau ngina", hymnsNumber: KkHymnsNumberSeeder.GENERAL_23, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5003, content: "Wantambula owau ngina,\nWantambula owau ngina,\nMono yambi kansi o Yise wa fwa,\nWantambula owau ngina,", hymnsNumber: KkHymnsNumberSeeder.GENERAL_23, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5004, position: 2, content: "Mu sela ngina ye ngolo nkatu,\nLuloloko lwaku umpana lo;\nWa fwa ekuma kunkula mono,\nWantambula owau ngina.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_23, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5005, position: 3, content: "Ôkani diambote diau,\nYengolo zame zilalanga mpe,\nWanvuluza mono munkenda zaku\nWantambula owau ngina.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_23, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5006, position: 1, content: "Ma masolandi ma Yisu,\nYeno akwikidi,\nNwa zangulanga edinga,\nNwa sunda mu vita.\nMu kati atwadimenga\nNuzizilanga kaka\nNulunda Ntumi a vita\nYandi i Nkubiki", hymnsNumber: KkHymnsNumberSeeder.GENERAL_24, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5007, position: 2, content: "Ma soladi ma Yisu,\nMa yandi nwaninu;\nNwa vwate nvuatu miandi,\nNwa diata ku ngolo,\nNu kala mpe ye kasu,\nMuna lu sambulu,\nMu ntangwa mpuku muni,\nYandi nu zizila.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_24, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5008, position: 3, content: "Ma soladi ma Yisu,\nKu tambi ya ngolo;\nMu vite yai ya mpasi,\nOunu nsunda yo,\nÔ wau ya nvu ya nvu,\nTu nkembela, nsundi,\nTu nkembela Nzambi eto\nYo Klistu nvuluzi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_24, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5009, position: 1, content: "O dia kwa moyo,\ndo umbukwina,\nNze i va ndambu a mbu\nwakay’o dia;\nMu Nkand’Avelela\nomweswanga,\nMwamu ntim’ame mpe\nwayisolola.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_25, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5010, position: 2, content: "U dia kwa moyo\nNge ungindula,\nMu diambu diaku mpe\nunkûdila,\nMbula yad’owau,\nyazingila:\nYo kwikila diau\nwanzolanga.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_25, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5011, position: 3, content: "Tum’ake Vumisu\nkanduakila,\nMeso manziulwilu\nyamweswanga.\nNkand’Aku Avelela\nunfukwila:\nYàlan’e betela,\nyafwane mpa.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_25, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5012, position: 4, content: "Vo Ludi kiaku nwa,\nsambula kio,\nOmama mfwete vwa,\nkiaveza moko;\nBosi yavevolwa,\nwayi uvwa:\nWete wawonsono\nusoloka.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_25, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5013, position: 1, content: "Nzambi sambula e nsi yeto\nUtu temona ntembo aku\nUtu wila wau Nzambi do\nUtu sambula, utu sambula.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5014, position: 2, content: "Wiza do! Wiza wiza\nWiza do! Wiza wiza\nSambula Nsi yeto Nzambi do\nYeto Nzambi do\nYeto Nzambi do", hymnsNumber: KkHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5015, position: 3, content: "Sambula ayasi a nsi yeto\nUba temona ntemo aku\nUba vana ngolo mu salu yau\nUba, sambula, uba sambula", hymnsNumber: KkHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5016, position: 4, content: "Sambula zinguadi yo ma sé\nNdumba yo ma toko yau mpe\nAleke a skola zawonsono\nUba, sambula, uba sambula.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5017, position: 1, content: "E Nfumu, mu tembwa kiampwena,\nTubukumukinanga,\nO mavuku mangolo mebeni\nMu mayangi malungidi,\nSe tadi, mavukumawonso\nE Nzanza melangana.\nE Nzanza se zala yo maza\nNangatu se fwa tufwa.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5018, content: "E tembwa kwa mono ilenvoka,\nKal’e pi-i!\nYovo e nsita za mavuku ma mbu,\nYovo za nkuya za wantu mpe,\nYa konzo nzanza nkalanga\nO maza ke malendi yo kula ko:\nYawonso kwa mono ilenvoka!\nKal’e pi-pi! Kal’e pi-pi!\nYawonso kwa mono ilenvoka:\nKal’epi-pi!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5019, position: 2, content: "E Nfumu mu mpasi za ntima\nTuvetamenanga wau,\nMu mpasi zawonso tumona,\nOzabuk’o vuluza!\nE nkuka za masumu meto\nE ntima zilangididi!\nTuvila! tuvila! E Nfumu!\nOzabuk’o lalula?", hymnsNumber: KkHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5020, position: 3, content: "E Nfumu, mu, diambu diaku,\nMu yanga mukedi e pi-pi;\nYo muna diaku,\nE ntima miavuvama.\nKadi wau o masumu meto\nOmene mo katula,\nDiau tuzolele kaka\nO toma kukembela", hymnsNumber: KkHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5021, position: 1, content: "A wonso amona mpasi,\nMuna nzila yai ngina;\nAu kalendi mona mwini,\nKuna mpolo i Kwenda nga,", hymnsNumber: KkHymnsNumberSeeder.GENERAL_28, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5022, content: "Mfumu Yisu unkanga lesa,\nWa iza kala kwa mono;\nMwamu nsi eyayi yampasi,\nMono kaka kilendiko.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_28, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5023, position: 2, content: "A vova mambu mambote,\nMalutezo kwa mono;\nKansi Yisu unsadisi,\nYo ku ndembeleka mpe.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_28, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5024, position: 3, content: "Luzolo lwa me ngolo nkatu,\nMuma sumu ya senzama;\nMu lusadisu lwandi kaka,\nLwau mpe isundila", hymnsNumber: KkHymnsNumberSeeder.GENERAL_28, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5025, position: 1, content: "Tuvatanga e yana\nE mbongo kuna mpe;\nWa nani omenesa yo?\nI Nzambi Ampungu do!\nE mvula zau kulu\nZai i kanokesa\nObayisang’o mwini,\nOmenesang’o dia.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5026, content: "O tukau twawonso,\nNzambi ovana to;\nTusiandam’o kuntondanga\nMu yayi Yawonsono.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5027, position: 2, content: "E lekwa in’ova nza,\nKwa Nzambi itukanga;\nOviengesa’e mvuma,\nNtetembwa temesa.\nOdikilang’e nuni,\nYawonso osasanga,\nMusungula yeto\nKeluta van’o dia,", hymnsNumber: KkHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5028, position: 3, content: "Matondo, Es’eto Nzambi,\nMu yayi yowonsono,\nOkutuvanang’aka,\nYa moyo, vimpi mpe.\nSe tambul’ake Nzambi,\nMatondo meto wau;\nLukau lua ntima mieto\nYamuna nvu ya nvu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5029, position: 1, content: "Empata-vat’a Betelem\nYa Yisu wa Nvuluzi,\nOfuku una kawutuka\nBayiza avungundi;\nBayiza teleka\nE ngiz’a ntetembwa\nYadingalele ova nzo\nIna kalekela.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5030, position: 2, content: "O Yisu, Mwan’a Maria,\nMu nlele kazingilu,\nMu dikilwa kia twelezi\nKwa ngw’ andi kalekeso.\n‘va nzanza kaka mbasi\nMu nkung’akembela,\nNkembo kwa Nzambi mu kaye\nLuvuvamu ‘va nza.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5031, position: 3, content: "Y Yisu, Mwan’a Betelem,\nMu ntim’ame wiza do!\nMu waku nkuma katula\nBi wame wawonsono;\nYatanginina ngeye,\nYasadil’aka mpe,\nUnsadisa yalenvokela\nO Mwan’a Nzambi oSe.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5032, position: 1, content: "Ndonga yingi izidi kala\nMuna vata dia Mbetelemi,\nAngudi ambuta azolele tala\nMwenesi Nzambi yau;\nNkembo kwa Nzambi kune Zulu\nLuvuvamu ya mu Nsi yai;\nLuzolokwau antu awonso,\nAu mbasi a imbila", hymnsNumber: KkHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5033, content: "Nwiza wa nsangu za mbote,\nNzambi ampungu nkembela;\nMfumu Yisu vuluzi wa ngolo\nMu Mbetelemi ka utilwa.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5034, position: 2, content: "Au abundu au nkangu,\nLuvambu lwau lu tabukidi.\nÔ Mwenese wa tu kula\nNzambi nloloki.\nYeka odila yimbila onkunga,\nMatondo kwa Nzambi nvuluzi,\nÔ Yisu o kadia Mpemba wa lunga,\nKu ngolo zi sundidi,", hymnsNumber: KkHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5035, position: 3, content: "Wilakaka ndinga mbote\nNfumu Yisu vovele.\nYeka nsoni landa kwa mono,\nMono kubiki.\nNkembo kwa Nzambi tunkembela\nWau ke una nsuka ko,\nNfumu Yisu, Nfumu wa nkenda\nMu Mbetelemi ka utilwa.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5036, position: 4, content: "Vova muna Nsi yau wonso\nkwa Mindele\nYe ndombe mpe,\nÔ Yisu nkwa zola kwa sunda,\nMu vuluza a sumuki.\nWiza kaka Nfumu Yisu,\nKalendi diabulu nkutu ko.\nWiza ô moko mandi ma sanzuka.\nMu Mbetelemi ka utilwa.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5037, position: 1, content: "Muna mpaka ya itwizi,\nMuna mbanza ya Mbetelemi.\nKwei wa ndonga banza\nYisu lenda utuka\nMwana Nzambi nvuluzi\nMuna mpaka ka utilwa.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5038, position: 2, content: "Yani Nfumu Nsi za wonso,\nMwamu Nsi ka utilwa;\nYani ntinu, Mwana Nzambi,\nMuna mpaka kalekeswa\nMpasi zandi bakidi,\nKukala Nvuluzi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5039, position: 3, content: "Muna vanga ô lutezo\nYani Yisu vwezele;\nÓ Madia ngwandia Yisu,\nNsiku wa Nzambi tondele.\nÔ ntimandi wa wonso,\nKwa yandi kavana wo.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5040, position: 4, content: "Tuzolanga wau mene,\nTuzai Yisu Nvuluzi\nEkuma yandi mwene mpasi\nFila eto muna nti,\nNkenda zandi songele,\nYo vana luvuluzu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5041, position: 5, content: "Bosi tukota kuna Zulu,\nKutu mwena Nvuluzi;\nYandi Ntinu yandi nlenvo,\nYandi Mfumu kwa yele nvu,\nNzile Zulu yangudi,\nTwa kala kwa Nzambi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5042, position: 1, content: "Minkwikizi nwiza\nNwiza kembelanga;\nNukembela Klisto oweto Nvuluzi\nOyandi i Nzambi eto avelela.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5043, content: "Tukembel’aka Yisu\nYe nsi a ntima mieto\nOyandi i Nzambi ampungu\nWa Nvuluzi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_33, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5044, position: 2, content: "Vava twakedinge\nMuna umpukumuni\nO Yisu wayizidi ova nza yayi,\nKanwana yo Mbeni\nNgolo zandi akatwidi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5045, position: 3, content: "Tukwikilang’aka\nMuna Yisu Klisto\nDianu twavuluzilwa muna mbi.\nE tumbu kieto Yisu watubakila.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_33, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5046, position: 1, content: "Luvuvamu o fuku wau,\nMuna ndombu aleko wau,\nMuna Mbetelemi kwa uilwa\nNtinu wa moyo wa Zulu ye Nsi,\nYisu invuluzi, Yisu invuluzi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5047, position: 2, content: "Luvuvamu o fuku wau\nMuna kiana avungudi,\nAuidi mpungi ayimbila\nNkembo alukulu lwa nvo ya mvo\nNkudia’me nkudia mpe é é.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5048, position: 3, content: "Luvuvamu o fuku wau,\nVana mpolo ye temoka;\nTuka lu watiku lwa Nsi yai,\nHana mpo ya moneka\nNtangwa temisa é é.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5049, position: 1, content: "Ya fwila muna nti\nKwa ngeye lenda vuluka,\nMoyo wame mpene wo ngeye\nÔlenda vuluka.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5050, content: "Ya fwa, ya fwa mu nti kwa nge,\nNki ovanga wau mpe?", hymnsNumber: KkHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5051, position: 2, content: "Ya kele wau kwa ngeye\nMpasi zisundidi;\nYa wonso mono mpangidi\nKukala nvuluzi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5052, position: 3, content: "Mu nti mbwene mpasi,\nKu vuluza ngeye.\nMoyo wa mpa ngina,\nWau mu ku vana wo.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5053, position: 4, content: "Mono ndete luvuluzu\nLwa nkembo we Zulu,\nIku loloka ma sumu\nMu luzolo lusundi di.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5054, position: 1, content: "Vana ndambu ekuluzu,\nO menga, za kiamvimba;\nVana i yakazila;\nI vuvu kiame kina.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5055, content: "Vana nti, vana nti,\nVana babilanga;\nVana ntoma vundila,\nYamu ntangw’a lufwa", hymnsNumber: KkHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5056, position: 2, content: "Vana ndambu ekuluzu\nYamwen’esumu dia yiva;\nVa yamon’o Nkomami\nYe mpasi ezi kamona.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5057, position: 3, content: "O Mbeni vo undwakidi,\nSe ikunsongaYisu,\nNtoma mpe kunkamba vo,\nI nlandi ngani a Yisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5058, position: 4, content: "Kimbambamba y’ekuluzu,\nYa konso kuna nkwenda\nYavana nsinga viengeswa\nE kolow’ame ankembo.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5059, position: 1, content: "Yisu kaka Nvuluzi, yani\nYisu kaka;\nYisu kaka i Nloloki, yani\nYisu kaka", hymnsNumber: KkHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5060, content: "Ediame, kembela, omaka nveza mo;\nInkunga nsimba mpe.\n«Nkembo kwa Yisu kaka».", hymnsNumber: KkHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5061, position: 2, content: "Vuvu kiame ova nza, yani\nYisu kaka;\nNvani a moyo a nvu ya nvu, yani\nYisu kaka.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5062, position: 3, content: "Nkundi oluta zolwanga, yani\nYisu kaka;\nYani I nzizidi, yani\nYisu kaka.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5063, position: 4, content: "Yani weto Nsundisi, yani\nYisu kaka;\nYani Yisu Nsundi a fwa, yani\nYisu kaka.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5064, position: 1, content: "Mfumu Yisu muna nti yani,\nKumpelesa wa nfwila mpe,\nYa velela muna menga owau,\nMenga ma Yisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5065, content: "Nkembo kwa Yisu é é,\nNkembo kwa Yisu é é,\nYani i Nfumu wa mpulula,\nNkembo kwa Yisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5066, position: 2, content: "Zola kwa kwingi kanzolele,\nMu nkenda zandi wandoloka\nWau nvuluka muna\nntambu’alufwa,\nNkembo kwaYisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5067, position: 3, content: "Ya ntonda wau kwa nvuluzi,\nMa wete mandi kapangidi,\nNtondele kwingi  munti ma me,\nNtondele Yisu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5068, position: 4, content: "Yeno nwa kula kwa Nvuluzi,\nNdingany kaka nu fwete wa,\nNwa kazila embila nwa\nbokelwa,\nNwiza kweno wau", hymnsNumber: KkHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5069, position: 1, content: "Klistu wafuluka o unu!\nAleluya!\nI tumwene wete wingi;\nAleluya!\nWau kafwila mun nti,\nAleluya!\nYani kwandi Nkundi eto.\nAleluya!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5070, position: 2, content: "Nkunga mia kunkembelela\nAleluya!\nYisu tukunyimbidila,\nAleluya!\nWau kayiza ova nsi,\nAleluya!\nMu kuma ki’’ asumuki.\nAleluya!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5071, position: 3, content: "E mpasi mpe ke zankatu ko,\nAleluya!\nWantu owau tuvulwizu;\nAleluya!\nKun’ezulu avatuka,\nAleluya!\nMbasi zikunkembelanga.\nAleluya!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_39, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5072, position: 1, content: "Mu nkal’azikilwa\nNvuluzi’ame;\nTalang’e nvunguka,\nYisu wa ntu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5073, content: "Kafuluka mu fwa!\nNsund’ampwena I kasundidi;\nSunda nkutu kafuluka mu fwa,\nKun’ezulu eyalanga y’aveledi!\nFuluka!.. Fuluka!..\nYisu wafuluka mu fwa.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_40, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5074, position: 2, content: "Nkatu banzikila,\nNvuluzi’ame;\nNkatu banyingila,\nYisu wa ntu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5075, position: 3, content: "Kalembwa kwa lufwa,\nNvuluzi ame;\nMbindi I katolola,\nYisu wa ntu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_40, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5076, position: 1, content: "Yimbila tuyimbila,\nMambu ma moyo mekumbwa;\nYisu olend’o vuluza,\nMambu ma moyo mekumbwa.\nYisu Mvuluzi eto,\nKatambul’e mpasi zeto.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_41, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5077, content: "Mambu mawete, mambu mambote,\nMambu ma moyo mekumbwa.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_41, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5078, position: 2, content: "Yisu Nkundi eto ofwa,\nMuna masumu meto;\nNkenda zingi kesonganga,\nMu kuma kia yeto;\nYisu Mwana Nzambi,\nWatuzola beni.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_41, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5079, position: 3, content: "Omambu mama nutoma wa,\nMambu ma Yisu Klistu,\nYani olend’o vuluza Mambu\nAsumuki awonso\nYisu kwandi kaka,\nOlend’o vuluza wantu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_41, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5080, position: 4, content: "Ovo yeto tukwikila\nMuna Yisu Klistu,\nYani olend’o loloka\nMambu meto mambi\nE Nzambi Tata,\nKu zulu utunata", hymnsNumber: KkHymnsNumberSeeder.GENERAL_41, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5081, position: 1, content: "Nzambi et’okutuyikama!\nKanusimba, kanufila\nMu luludiku luani;\nNzambi okala yeno wau\ntuvambana!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5082, content: "Tusa wanana! Tusa wanana!\nNzo a Yisu ova tumona yo,\nTusa wanana! Tusa wanana!\nKun’ezulu ova tukwenda ko.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5083, position: 2, content: "Nzambi et’okunuyikama!\nMuna mave okunukonka\nKanuvan’o dia kweno!\nNzambi okala yeno\nwautuvambana!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5084, position: 3, content: "Nzambi et’okunuyikama!\nWavo sumbula numona,\nYovo vonza ikunuzieta;\nNzambi okala yeno\nwautuvambana!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5085, position: 4, content: "Nzambi et’okunuyikama!\nVo nuyel’okunu wuka,\nVo mu vimpi okunulunda;\nNzambi okala yeno\nwautuvambana!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5086, position: 1, content: "Ki yangu kivi ekielo\nA lonso alenda kota,\nEnkwa ma sumu mwelo wau;\nKota wa vulukampe.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5087, content: "Taleno enkenda za Yisu\nMwelo wa zulu uzunkidi.\nMono… mono ya kota ku Zulu.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_43, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5088, position: 2, content: "Kota nu Mwese wese ntu,\nNwa lombe nkenda Kwa Yisu.\nKoteno yenu nwa vuluka.\nNwa kala kwano kia mbote.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5089, position: 3, content: "Zangu kidi mene ôwau,\nKoteno yeno a wonso;\nNzambi usonge nkenda,\nNkenda za yani za zayingi", hymnsNumber: KkHymnsNumberSeeder.GENERAL_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5090, position: 4, content: "E sunda muna mbi,\nWakala kune Zulu;\nWa kalo ko yo Nfumu aku,\nNzambi i ntinu waku.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_43, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5091, position: 1, content: "Vav’e mpungi a Nfumu itatula\nye nza ivempoka,\nVav’o kuma kusa kia kwayele nvu,\nVav’Aklisto kun’evundilu\nbemana kutama,\nVa belungwa isinga kala vana mpe", hymnsNumber: KkHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5092, content: "Vav’e nkumbu ziza bokwa\nVav’e nkumbu ziza bokwa\nVav’e nkumbu ziza bokwa\nVana ntambulwila ngina vana mpe", hymnsNumber: KkHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5093, position: 2, content: "Muna menemene una avo\nAklisto befuluka,\nVa bemon’o nkembo a\nlufuluku:\nAy’asolwa ‘va bekota kaka\nmuna vundu kiau\nVa belungwa isinga kala vana mpe", hymnsNumber: KkHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5094, position: 3, content: "Ya mbula yasadil’ak’o Nfumu\nyaku mbaninu\nMoken’ak’esivi dia luvuluzu;\nVa kivwa e zingu kiaki, salu\nmpe kifokoka,\nVa belungwa isinga kala vana mpe", hymnsNumber: KkHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5095, position: 1, content: "Aleke a yelusalemi\nYisu bekunkembela;\nAleke mpe omu nsi yayi\nNkembo andi beyimbila.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5096, content: "Wa! Wa! Wa!\nAleke beyimbilanga,\nAleluya kwa Nfumu au.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_45, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5097, position: 2, content: "E nsangu zambote tulongwanga\nO zola kwa Yisu tumona ko;\nNkand’a Nzambi tutangana\nDianu tukukembela.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5098, position: 3, content: "A mase, a ngudi, a mpangi mpe,\nE ndinga zeno nuzangula:\nMvuluzi eto tunkembela.\nYavana ku ‘zulu tumonana.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_45, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5099, position: 1, content: "Yisu utuzolele,\nNkand’a Nzambi uvovele wo;\nYeto awonso tu alandi,\nOkutulundanga.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_46, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5100, content: "Yisu utuzolele,\nElo, utuzolele,\nYisu utuzolele,\nOyandi Nkundi eto.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_46, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5101, position: 2, content: "Yisu utuzolele,\nYandi utufwididi,\nSumu dieto okatwidi,\nMwelo ezulu kaziwidi.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_46, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5102, position: 3, content: "Yisu utuzolele,\nYandi utulundidi,\nOvo tukuntondanga,\nKu nsi andi tukwendanga.", hymnsNumber: KkHymnsNumberSeeder.GENERAL_46, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5103, position: 1, content: "Kunang’e mbongo,\nYe mbongo ya nkenda,\nMene-mene mwini,\nOvo masika,\nVinganga e kundi,\nNsungi a salwa,\nTukemba ye kiese,\nNtete tuna miau!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_47, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5104, content: "Ntete tuna miau!\nNtete tuna miau!\nTukemba ye kiese,\nNtete tuna miau!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_47, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5105, position: 2, content: "Vatange kiana,\nVetamanga kwingi;\nNvula yovo mwini,\nKe tutina ko;\nNsungi a salu,\nSalu kivwidi,\nTukemba ye kiese,\nNtete tuna miau!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_47, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5106, position: 3, content: "Nsangu za Yisu,\nO nvuluzi a wantu,\nMbongo a kuna muna\nNtima miau;\nOvo yau banlende\nKwikilang’e ludi,\nTukemba ye kiese,\nNtete tuna miau!", hymnsNumber: KkHymnsNumberSeeder.GENERAL_47, typeStanza: HymnsContentCode.VERSE),

  ];
}